import "./Settings.css";

export function SettingsPage() {
  return (
    <div className="settingspage-container">
      <h1 className="settingspage-title">Settings</h1>
      <div className="settingspage-content">
        <p className="settingspage-text">
          Application settings will be displayed here.
        </p>
      </div>
    </div>
  );
}
